import React from "react";

export default function Header() {
  return (
    <div
      className="Header position-fixed w-100 t-0 d-flex align-items-center justify-content-between "
      style={{
        padding: "0 10rem",
        fontSize: "1.6rem",
        backgroundColor: "#1d1d26",
      }}
    >
      <a
        className="logo"
        href="http://"
        style={{
          textTransform: "uppercase",
          fontSize: "3rem",
          fontWeight: "700",
        }}
      >
        <div className="logo__text">todo</div>
      </a>
      <div className="header__buttons d-flex align-items-center">
        <button
          href="svsdv"
          className="header__button button btn--none-border btn--hover-bb mb-0"
          style={{ marginRight: "2rem" }}
        >
          Sign in
        </button>
        <button
          href="sdvsdv"
          className="header__button button btn--border btn--hover-border mb-0"
        >
          Sign up
        </button>
      </div>
    </div>
  );
}
